import React from "react";
import ReactAnimatedWeather from "react-animated-weather";
import "./WeekWeatherStyle.css";

export default function Icon(props) {
const codeMapping = {
    "01d": "Clear"
}


  if (props.code === "01d") {
    return (
      <ReactAnimatedWeather
        icon="CLEAR_DAY"
        color="black"
        size={25}
        animate={false}
      />
    );
  } else {
    return (
      <ReactAnimatedWeather
        icon="CLEAR_NIGHT"
        color="black"
        size={25}
        animate={false}
      />
    );
  }
}
